import React from "react";

const Mix = ({ mixes }) => (
  <div>
    {mixes.map((mix) => (
      <section>
        <img src={mix.pictures.medium} />
        <p>

          {mix.name}
        </p>
        <p>{mix.user.name}</p>
      </section>
    ))}
  </div>
);

export default Mix;
